window.bookSummaryJSON = "<p><b>On the eastern plains of the continent, Sungchul discovers a utopia.</b></p> <p>Ixion, the city of mages, has seemingly transformed into a perfect society. It faces no shortage of resources, thanks to Vestiare of the Seven Heroes and her Colossus. However, its inhabitants have turned to the heretical worshiping of a Lesser God.</p> <p>Beauty is skin deep, and this facade of perfection shrouds the intentions of the Seven Heroes: The Second Calamity. In the midst of it all, Sungchul finally begins making progress toward a more personal goal...</p>"; 
